import gsap from 'gsap';
import * as particles from '@pixi/particle-emitter'
import { Application } from './core/Application';
import { Container } from './core/Container';
import { log, PLATFORMS, APP_STORE, PLAY_MARKET, sprites } from './const';
import configEmitter from './particleConfig.js';
import { Howl, Howler } from 'howler';

const container = new Container(),
    containerLogo = new Container(),
    containerPackshot = new Container(),
    containerBackground = new Container(),
    containerField = new Container(),
    containerBar = new Container(),
    containerEmitter = new Container();

export const app = new Application();

//sprites
let bg;
export let crystalsBar;
app.toPackshot = toPackshot;
app.loadTextures();
app.loader.onComplete.add(doneLoading);

const music = new Howl({
    src: 'data:audio/mpeg;base64,',
    loop: true,
    volume: 0.3
})

const click = new Howl({
    src: 'data:audio/mpeg;base64,',
})

const merge = new Howl({
    src: 'data:audio/mpeg;base64,',
    volume: 2
})

const whoosh = new Howl({
    src: 'data:audio/mpeg;base64,',
    volume: 2
})

document.addEventListener('visibilitychange', function () {
    if (document.visibilityState === 'visible') {
      Howler.volume(1);
    } else {
      Howler.volume(0);
    }
    });

app.sounds = {
    music: music,
    click: click,
    merge: merge,
    whoosh: whoosh
}

window.addEventListener('resize', () => app.resizeApp());

function doneLoading() {
    log('DONE LOADING!');
    addContainers();
    app.loadSprites();
    createBack();
    app.resizeApp();
    app.ticker.add(update);
}

function addContainers() {
    app.stage.sortableChildren = true;
    app.stage.addChild(container);
    app.stage.addChild(containerLogo);
    app.stage.addChild(containerPackshot);
    app.stage.addChild(containerBackground);
    app.stage.addChild(containerBar);
    app.stage.addChild(containerEmitter);
    container.addChild(containerField);
    container.zIndex = 100;
    containerLogo.zIndex = 100;
    containerBar.zIndex = 150;
    containerEmitter.zIndex = 90;
    containerPackshot.zIndex = 1000;
}

function createBack() {
    const blackRect = new PIXI.Graphics();
    bg = app.getSprite('bg');
    const btnDownload = app.getSprite('btnDownload');
    btnDownload.alpha = 0;
    blackRect.beginFill(0x000, 1);
    blackRect.drawRect(-695, -695, 1390, 1390);
    blackRect.endFill();

    containerBackground.addChild(bg);
    containerPackshot.addChild(blackRect);

    gsap.to(blackRect, { alpha: 0, duration: 1.5 });
    gsap.delayedCall(0.5, startPlayable);
}

function startPlayable() {
    music.play();
    startGame();
}

function startGame() {
    const logo = app.getSprite('logo');
    const lock = app.getSprite('lock');
    const episode4 = app.getSprite('episode4');
    gsap.to(logo, { y: 80, duration: 1, alpha: 1 });
    gsap.to(lock.scale, { x: 1.1, y: 1.1, duration: .5, ease: "power1.inOut", repeat: -1, yoyo: true })
    container.addChild(lock, episode4);
    containerLogo.addChild(logo);
    lock.onClick(transitionAnimation);
    handStartAnimation();
}

function handStartAnimation() {
    const hand = app.getSprite('hand');
    hand.anchor.set(.5);
    const lock = app.getSprite('lock');
    container.addChild(hand);
    const handTm = gsap.timeline({ repeat: -1 });
    lock.handAnimation = handTm;
    handTm
        .to(hand, { x: 30, y: -30, angle: 5, alpha: 1, ease: "power1.inOut", duration: .5 })
        .to(hand, { x: 40, y: -40, angle: -5, alpha: 1, ease: "power1.inOut", duration: .5 })
        .to(hand.scale, { x: .9, y: .9, angle: 5, ease: "power1.inOut", duration: .5 }, '<')
        .to(hand, { x: 30, y: -30, angle: 5, alpha: 1, ease: "power1.inOut", duration: .5 })
        .to(hand, { x: 70, y: -70, angle: -5, alpha: 1, ease: "power1.inOut", duration: .5 })
        .to(hand.scale, { x: 1, y: 1, angle: 5, ease: "power1.inOut", duration: .5 }, '<')
        .to(hand, { angle: 0, alpha: 0, ease: "power1.inOut", duration: .5 })
    hand.startAnimation = handTm;
}

function transitionAnimation() {
    click.play();
    const lock = app.getSprite('lock');
    const hand = app.getSprite('hand');
    const episode4 = app.getSprite('episode4');
    hand.startAnimation.pause();
    container.removeChild(lock, hand, episode4);
    // gsap.to(hand, { alpha: 0, duration: .5 })
    gsap.to(lock.scale, { x: 1.5, y: 1.5, duration: .5 })
    gsap.to(lock, { alpha: 0, duration: .5 })
    gsap.to(episode4, { alpha: 0, duration: .5 })
    lock.handAnimation.kill();
    startGameplay();
}

function startGameplay() {
    const field = app.getSprite('field');
    const btnDownload = app.getSprite('btnDownload');
    btnDownload.alpha = 1;
    btnDownload.onClick(() => app.toStore(PLATFORMS.al, APP_STORE, PLAY_MARKET));
    const mergeThem = app.getSprite('mergeThem');
    gsap.to(mergeThem, {
        alpha: 1,
        duration: 0.5,
        onComplete: () => {
            gsap.to(mergeThem.scale, {
                x: 1.3,
                y: 1.3,
                ease: "power1.inOut",
                repeat: 9999999,
                yoyo: true,
                duration: 1,
            });
            const tween = new gsap.to(mergeThem, {
                angle: -3,
                ease: "power1.inOut",
                duration: 0.5,
                onComplete: function () {
                    gsap.to(mergeThem, {
                        angle: 0,
                        ease: "power1.inOut",
                        duration: 0.5,
                        onComplete: function () {
                            tween.restart();
                        },
                    });
                },
            });
        },
    });
    crystalsBar = app.getSprite('crystalsBar');
    const coinsBar = app.getSprite('coinsBar');
    field.createGrid();
    field.setRandomCells();
    container.addChild(mergeThem);
    containerBar.addChild(crystalsBar, coinsBar, btnDownload);
    containerField.addChild(field);
    gsap.fromTo(field, { alpha: 0 }, { alpha: 1, duration: .3 })
    gsap.fromTo(field.scale, { x: 0.7, y: 0.7 }, { x: 1, y: 1, ease: 'power2.inOut', duration: .5 })
    field.tutorial();
}

function ratioSettings() {
    const crystalsBar = app.getSprite('crystalsBar');
    const coinsBar = app.getSprite('coinsBar');
    const mergeThem = app.getSprite('mergeThem');
    const btnDownload = app.getSprite('btnDownload');
    const logo = app.getSprite('logo1');
    const logoText = app.getSprite('logoText');
    const continueButton = app.getSprite('continueButton');
    containerLogo.x = -window.innerWidth / 2;
    containerLogo.y = -window.innerHeight / 2;
    containerBar.x = -window.innerWidth / 2;
    containerBar.y = -window.innerHeight / 2;
    
    if (window.innerWidth < window.innerHeight) {
        crystalsBar.position.set(280, 85);
        coinsBar.position.set(490, 90);
        mergeThem.texture = app.getTexture('merge_them_texture');
        mergeThem.position.set(0, -350);
        container.addChild(btnDownload);
        btnDownload.position.set(0, 400);
        logo.position.set(0, -300);
        logoText.position.set(0, 0);
        continueButton.position.set(0, 300);
    } else {
        crystalsBar.position.set(window.innerWidth / container.valueScale - crystalsBar.width / 2 - 50, 90);
        coinsBar.position.set(window.innerWidth / container.valueScale - coinsBar.width / 2 - 50, 190);
        mergeThem.texture = app.getTexture('merge_them_hor_texture');
        mergeThem.position.set(-440, 0);
        containerBar.addChild(btnDownload);
        btnDownload.position.set(window.innerWidth / container.valueScale - crystalsBar.width / 2 - 80, 330);
        logo.position.set(-450, 0);
        logoText.position.set(0, 0);
        continueButton.position.set(450, 0);
    }
}

function toPackshot() {
    app.sounds.whoosh.play();
    app.sounds.music.fade(0.3, 0, 1000)
    const btn = app.getSprite('btnDownload');
    const back = app.getSprite('back');
    const logo = app.getSprite('logo1');
    const field = app.getSprite('field');
    const continueButton = app.getSprite('continueButton');
    const logoText = app.getSprite('logoText');
    const mergeThem = app.getSprite('mergeThem');
    const packshotTm = gsap.timeline();
    packshotTm
        .to(field, { alpha: 0, duration: .5 })
        .to(field.scale, { x: 0, y: 0, duration: .5, onComplete: () => container.removeChild(containerField)})
        .fromTo(back, { alpha: 0 }, { alpha: .5, duration: .5 }, '<')
        .fromTo([logo, continueButton, logoText], { alpha: 0 }, { alpha: 1, duration: .5 })

    continueButton.onClick(() => app.toStore(PLATFORMS.al, APP_STORE, PLAY_MARKET));
    btn.visible = false;
    container.removeChild(mergeThem);
    app.stage.removeChild(containerBar);
    btn.parent.removeChild(btn);
    gsap.from(continueButton.scale, { x: 1.1, y: 1.2, ease: "elastic", repeat: 9999999, yoyo: true, duration: 1.5 });
    gsap.from(continueButton, { angle: 2, ease: "elastic", repeat: 9999999, yoyo: true, duration: 1.5 });
    containerPackshot.addChild(back, logo, continueButton, logoText);
}

function update(delta) {
    ratioSettings();

    var now = Date.now();
    emitter.update((now - elapsed) * 0.001);
    elapsed = now;
}

var emitter = new particles.Emitter(containerEmitter, configEmitter);
// Calculate the current time
var elapsed = Date.now();

emitter.emit = true;



